//Header.js component module
import React from 'react'
import { Link } from 'react-router-dom';
 function Header() {
  return ( <>

<nav class="navbar navbar-expand-lg navbar-light"
 style={
      {
        backgroundColor:'#475562',
        borderBottom:'0.5px white solid',
        borderTop:'0.5px white solid'
        
      }
}>
   
  <div classN="container-fluid">
   
    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse justify-content-end" id="navbarSupportedContent">
      <ul class="navbar-nav">
        <li class="nav-item">
          <Link class="nav-link active text-white" to="/home">Home</Link>
        </li>
        <li class="nav-item">
          <Link class="nav-link text-white" to="/about">About</Link>
        </li>
        
        <li class="nav-item">
          <Link class="nav-link text-white" to="/services">Services</Link>
        </li>
        <li class="nav-item">
          <Link class="nav-link text-white" to="/contact">Contact</Link>
        </li>
      </ul>
      
    </div>
  </div>
</nav>

       {/* <Link to="/home">Home</Link>&nbsp;&nbsp;
       <Link to="/about">About</Link>&nbsp;&nbsp;
       <Link to="/services">Services</Link>&nbsp;&nbsp;
       <Link to="/contact">Contact</Link>&nbsp;&nbsp; */}

    </>
  )
}
export default Header;
